import React from 'react';
import Detail from './detail';
import List from './list';
import { ApiCall } from '../services/Api';


class App extends React.Component {
    componentDidMount() {
        ApiCall()
            .then(data => console.log(data))
    }
    render() {
        return (
            <div>
                <p>PROBANDO QUE FUNCIONA</p>
                <List />
            </div>
        )
    }
}
export default App;
